import React, { useState ,useEffect,useContext} from 'react';
import {Alert, Modal,Pressable, Text,StyleSheet,  Button,
  View,ScrollView ,Image,ImageBackground,Picker,StatusBar,ActivityIndicator,Linking} from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';

const Footer =(props) =>{ 

  const handleWebPress =() => {
    Linking.openURL("http://www.yobeen.com");
}

return(

<View style={{flexDirection:'row'}}>
   
    
<TouchableOpacity  onPress={handleWebPress}>
<View style={{flexDirection:'row'}}>
<Text style={styles.foot1}>&copy;Powered by </Text>
<Text style={styles.foot}>Yobeen</Text>


</View>
             </TouchableOpacity>
</View>
    );
};

export default Footer;

const styles = StyleSheet.create({

foot:{
    fontSize:12,
    color:'#f5af19',
    fontWeight:'bold',
   //marginRight:20,
    

    //marginLeft:"%"
        },
        foot1:{
          
          fontSize:12,
         color:"black",
         
marginLeft:'67%'                 
 },

